import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Pausable.sol";

/**
 * @dev Abstraction over common strategy components.
 */
abstract contract StratManager is Ownable, Pausable {
    event NewKeeper(address newKeeper);

    address public keeper; // Address to manage a few lower risk features of the strat
    address public strategist; // Address of the strategy author/deployer where strategist fee will go.
    address public unirouter; // Address of exchange to execute swaps.
    address public vault; // Address of the vault that controls the strategy's funds.
    address public serviceFeeRecipient; // Address to receive service fees.

    constructor(
        address _keeper,
        address _strategist,
        address _unirouter,
        address _vault,
        address _serviceFeeRecipient
    ) public {
        require(
            _keeper != address(0) &&
                _strategist != address(0) &&
                _unirouter != address(0) &&
                _vault != address(0) &&
                _serviceFeeRecipient != address(0),
            "!0 Address"
        );

        keeper = _keeper;
        strategist = _strategist;
        unirouter = _unirouter;
        vault = _vault;
        serviceFeeRecipient = _serviceFeeRecipient;
    }

    // checks that caller is either owner or keeper.
    modifier onlyManager() {
        require(msg.sender == owner() || msg.sender == keeper, "!manager");
        _;
    }

    /**
     * @dev Updates address of the strat keeper.
     * @param _keeper new keeper address.
     */
    function setKeeper(address _keeper) external onlyManager {
        require(_keeper != address(0), "!0 Address");

        keeper = _keeper;

        emit NewKeeper(_keeper);
    }

    /**
     * @dev Updates address where strategist fee earnings will go.
     * @param _strategist new strategist address.
     */
    function setStrategist(address _strategist) external {
        require(msg.sender == strategist, "!strategist");
        require(_strategist != address(0), "!0 Address");

        strategist = _strategist;
    }

    /**
     * @dev Updates router that will be used for swaps.
     * @param _unirouter new unirouter address.
     */
    function setUnirouter(address _unirouter) external onlyOwner {
        require(_unirouter != address(0), "!0 Address");

        unirouter = _unirouter;
    }

    /**
     * @dev Updates parent vault.
     * @param _vault new vault address.
     */
    function setVault(address _vault) external onlyOwner {
        require(_vault != address(0), "!0 Address");

        vault = _vault;
    }

    /**
     * @dev Updates beefy fee recipient.
     * @param _serviceFeeRecipient new beefy fee recipient address.
     */
    function setServiceFeeRecipient(address _serviceFeeRecipient)
        external
        onlyOwner
    {
        require(_serviceFeeRecipient != address(0), "!0 Address");

        serviceFeeRecipient = _serviceFeeRecipient;
    }

    /**
     * @dev Function to synchronize balances before new user deposit.
     * Can be overridden in the strategy.
     */
    function beforeDeposit() external virtual {}
}

