// SPDX-License-Identifier: MIT

pragma solidity >=0.6.12;

import "../../Interfaces/Rebasing/IRebaseStaker.sol";
import "../../Interfaces/Rebasing/IStakingManager.sol";
import "../../Interfaces/Uniswap/IUniswapRouterEth.sol";
import "../../Interfaces/Uniswap/IUniswapV2Pair.sol";

import "../Common/FeeManager.sol";
import "../Common/StratManager.sol";

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC20/SafeERC20.sol";

/**
 * @dev Rebasing DAO yield optimizer for spartacus.finance
 * @author minimum.finance
 */
contract StrategySpartacus is StratManager {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    /**
     * @dev Third party contracts:
     * {want}               - Erc20 used to swap for the {rebaseToken}
     * {rebaseToken}        - The rebasing token used by the strategy
     * {stakedRebaseToken}  - The staked version of the {rebaseToken}
     * {wantRebasePair}     - The Uniswap pair for {want} and {rebase}
     * {rebaseStaker}       - The rebase StakingHelper contract
     * {stakeManager}       - The rebase OlympusStaking contract
     */
    address public want;
    address public constant rebaseToken =
        0x5602df4A94eB6C680190ACCFA2A475621E0ddBdc; // SPA
    address public constant stakedRebaseToken =
        0x8e2549225E21B1Da105563D419d5689b80343E01; // sSPA
    IUniswapV2Pair public wantRebasePair;
    address public rebaseStaker;
    address public stakeManager;

    /**
     * @dev Strategy behavior config:
     * {minDeposit}         - The minimum threshold of {want} to enter rebasing
     */
    uint256 public minDeposit;

    address[] public wantToRebaseRoute;
    address[] public rebaseToWantRoute;

    /**
     * @dev Events emitted:
     * {Deposit}            - Emitted when funds are deposited into the strategy
     * {Withdraw}           - Emitted when funds are withdrawn from the strategy
     * {Stake}              - Emitted when {rebaseToken} is staked
     * {Unstake}            - Emitted when {rebaseToken} is unstaked
     *
     * @notice trl - Total Rebasing Locked
     */
    event Deposit(uint256 trl);
    event Withdraw(uint256 trl);
    event Stake(uint256 rebaseAmount);
    event Unstake(uint256 rebaseAmount);

    constructor(
        address _vault,
        address _want,
        IUniswapV2Pair _wantRebasePair,
        address _rebaseStaker,
        address _stakeManager,
        address _keeper,
        address _strategist,
        address _unirouter,
        address _serviceFeeRecipient,
        uint256 _minDeposit,
        address[] memory _wantToRebaseRoute,
        address[] memory _rebaseToWantRoute
    )
        public
        StratManager(
            _keeper,
            _strategist,
            _unirouter,
            _vault,
            _serviceFeeRecipient
        )
    {
        require(
            _want != address(0) &&
                _rebaseStaker != address(0) &&
                _stakeManager != address(0),
            "!0 Address"
        );

        want = _want;
        wantRebasePair = _wantRebasePair;
        rebaseStaker = _rebaseStaker;
        stakeManager = _stakeManager;
        minDeposit = _minDeposit;
        require(_wantToRebaseRoute[0] == want, "wantToRebaseRoute[0] != want");
        require(
            _wantToRebaseRoute[_wantToRebaseRoute.length - 1] == rebaseToken,
            "wantToRebaseRoute[last] != rebaseToken"
        );
        wantToRebaseRoute = _wantToRebaseRoute;

        require(
            _rebaseToWantRoute[0] == rebaseToken,
            "rebaseToWantRoute[0] != rebaseToken"
        );
        require(
            _rebaseToWantRoute[_rebaseToWantRoute.length - 1] == want,
            "rebaseToWantRoute[last] != want"
        );
        rebaseToWantRoute = _rebaseToWantRoute;

        _giveAllowances();
    }

    function _giveAllowances() internal {
        IERC20(want).safeApprove(unirouter, type(uint256).max);
        IERC20(rebaseToken).safeApprove(rebaseStaker, type(uint256).max);
        IERC20(rebaseToken).safeApprove(unirouter, type(uint256).max);
        IERC20(stakedRebaseToken).safeApprove(stakeManager, type(uint256).max);
    }

    function balanceOfWant() public view returns (uint256) {
        return IERC20(want).balanceOf(address(this));
    }

    function totalRebasing() public view returns (uint256) {
        return unstakedRebasing().add(stakedRebasing());
    }

    function unstakedRebasing() public view returns (uint256) {
        return IERC20(rebaseToken).balanceOf(address(this));
    }

    function stakedRebasing() public view returns (uint256) {
        return IERC20(stakedRebaseToken).balanceOf(address(this));
    }

    function availableWant() public view returns (uint256) {
        return balanceOfWant(); // Likely to change when/if there are reserves
    }

    function totalBalance() external view returns (uint256) {
        uint256 rebaseWantValue;
        uint256 rebaseAmount = unstakedRebasing().add(stakedRebasing());

        if (rebaseAmount > 0) {
            rebaseWantValue = rebaseAmountToWant(rebaseAmount);
        }

        return balanceOfWant().add(rebaseWantValue);
    }

    /**
     * @dev Deposit available {want} into Spartacus
     * @notice Emits Deposit(trl)
     */
    function deposit() external {
        uint256 wantBal = availableWant();

        if (wantBal > 0) {
            _enter(wantBal);

            emit Deposit(totalRebasing());
        }
    }

    /**
     * @dev Whether the strategy is currently bonding or staking,
     * swap for SPA and immediately stake.
     */
    function _enter(uint256 _amount) internal {
        if (_amount < minDeposit) {
            return;
        }
        _swapForRebasing(_amount);

        _stake();
    }

    /**
     * @dev Swap {want} for {rebaseToken}.
     * @param _wantAmount The amount of {want} to swap for {rebaseToken}.
     * @notice If {_wantAmount} is greater than the available {want}
     *         swaps all available {want}.
     */
    function _swapForRebasing(uint256 _wantAmount) internal {
        if (_wantAmount > availableWant()) {
            _wantAmount = availableWant();
        }
        IUniswapRouterETH(unirouter).swapExactTokensForTokens(
            _wantAmount,
            0,
            wantToRebaseRoute,
            address(this),
            now
        );
    }

    /**
     * @dev Swap {rebaseToken} for {want}.
     * @param _rebaseAmount The amount of {rebaseToken} to swap for {want}.
     * @notice If {_rebaseAmount} is greater than the available {rebaseToken}
     *         swaps all available {rebaseToken}.
     * @notice Make sure to unstake {stakedRebaseToken} before calling!
     */
    function _swapForWant(uint256 _rebaseAmount) internal {
        if (_rebaseAmount > unstakedRebasing()) {
            _rebaseAmount = unstakedRebasing();
        }
        IUniswapRouterETH(unirouter).swapExactTokensForTokens(
            _rebaseAmount,
            0,
            rebaseToWantRoute,
            address(this),
            now
        );
    }

    /**
     * @dev Stake all of the strategy's rebasing tokens.
     */
    function _stake() internal {
        uint256 _amount = unstakedRebasing();
        if (_amount == 0) {
            return; // TODO: Should there be a minStakeAmount?
        }
        IRebaseStaker(rebaseStaker).stake(_amount);

        emit Stake(_amount);
    }

    /**
     * @dev Unstake {stakedRebasingToken}.
     * @param _amount Amount of {stakedRebasingToken} to unstake
     * @notice if _amount exceeds the strategy's balance of
     * {stakedRebasingToken}, unstake the remainder.
     */
    function _unstake(uint256 _amount) internal {
        if (_amount == 0) {
            return; // TODO: Should there be a minUnstakeAmount?
        }
        if (_amount > stakedRebasing()) {
            _amount = stakedRebasing();
        }

        IStakingManager(stakeManager).unstake(_amount, true);

        emit Unstake(_amount);
    }

    /**
     * @dev Withdraws funds from staked {rebaseToken} and sends them back to the vault.
     * @param _amount The amount of {want} to withdraw.
     * @notice emits Withdraw(TRL)
     */
    function withdraw(uint256 _amount) external {
        require(msg.sender == vault, "!Vault");
        uint256 stratWant = balanceOfWant();

        if (stratWant < _amount) {
            // convert _amount outstanding in want to _amount in SPA
            uint256 spaOutstanding = wantAmountToRebase(_amount.sub(stratWant));
            uint256 unstakedAmount = unstakedRebasing();

            if (unstakedAmount < spaOutstanding) {
                // Unstake to have enough SPA to swap
                _unstake(spaOutstanding.sub(unstakedAmount));
                spaOutstanding = unstakedRebasing();
            }
            _swapForWant(spaOutstanding);

            // If we don't have enough to withdraw _amount, give what we can
            if (balanceOfWant() < _amount) {
                _amount = balanceOfWant();
            }
        }

        IERC20(want).safeTransfer(vault, _amount);

        emit Withdraw(totalRebasing());
    }

    function wantAmountToRebaseWithFee(uint256 _amount)
        external
        view
        returns (uint256)
    {
        return
            IUniswapRouterETH(unirouter).getAmountsOut(
                _amount,
                wantToRebaseRoute
            )[1];
    }

    function rebaseAmountToWantWithFee(uint256 _amount)
        external
        view
        returns (uint256)
    {
        return
            IUniswapRouterETH(unirouter).getAmountsOut(
                _amount,
                rebaseToWantRoute
            )[1];
    }

    // calculate price based on pair reserves
    function wantAmountToRebase(uint256 _amount) public view returns (uint256) {
        (uint256 Res0, uint256 Res1, ) = wantRebasePair.getReserves();

        return _amount.mul(Res0).div(Res1); // return # of token0 needed to buy _amount of token1
    }

    // calculate price based on pair reserves
    function rebaseAmountToWant(uint256 _amount) public view returns (uint256) {
        (uint256 Res0, uint256 Res1, ) = wantRebasePair.getReserves();

        return _amount.mul(Res1).div(Res0); // return # of token0 needed to buy _amount of token1
    }
}

